import React from 'react';
import { Link } from 'react-router-dom';

import Row from 'react-bootstrap/Row'
import Container from 'react-bootstrap/Container'
import Col from 'react-bootstrap/Col'
// import * from 'react-bootstrap'

// https://react-icons.netlify.com/#/
import { AiTwotoneHome } from 'react-icons/ai';
import { FaSmile } from 'react-icons/fa';
import { FaPills } from 'react-icons/fa';
import { FaUserAlt } from 'react-icons/fa';

// import { Container, Row, Col } from 'react-bootstrap';
import '../../styles/css/layout/navigation.css';

class Navbar extends React.Component {
    constructor(props) {
        super(props);
    }
    render() {

        return (
            <Container className="Navbar" fixed="bottom">
                <Row>
                    {/* <Col>hi</Col>
                    <Col>hi</Col> */}
                    <Col xs={4}><Link to="/home"><AiTwotoneHome className="NavIcon" /></Link></Col>
                    <Col xs={4}><Link to="/mood-list"><FaSmile className="NavIcon" /></Link></Col>
                    <Col xs={4}><Link to="/med-list"><FaPills className="NavIcon" /></Link></Col>
                    <Col xs={4}><Link to="/profile"><FaUserAlt className="NavIcon" /></Link></Col>
                </Row>
            </Container>
        );

    }
};

export default Navbar;
